import DefaultLayout from './layouts/DefaultLayout';
import PlanFinder from './components/UlapPayroll/PlanFinder';import Home from './components/Ulap/Home';

const routes = [
  {
    path: '/',
    element: DefaultLayout,
    children: [
      {
        path: '/',
        element: Home,
      },
    ],
  },
];

export default routes;
